import React from "react";
import AppFooter from "../AppFooter";
import './style.css'
export default function Layout({ children, title, background,page }) {

  return (
    <div className="dl-layout" style={{ background: background }}>
      <div className="dl-l-cont">
        <div className="dl-l-title">
          <h1 className="dl-l-t-text">{title}</h1>
        </div>
        {children}
      </div>
      <AppFooter
      page={page}
      />
    </div>
  );
}
